import Link from 'next/link';
import styled from 'styled-components';

const Container = styled.div`
  width: 100%;
  border-bottom: 1px solid black;
`;

const Nav =styled.ul`
  padding: 10px 15px;
  margin: 0;
  list-style: none;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: flex-start;
`;

const NavItems = styled.li`
  padding-right: 15px;
`;

const Navigation = () => {
  return (
    <Container>
      <Nav>
        <NavItems>
          <Link href="/">Home</Link></NavItems>
        <NavItems>menu1</NavItems>
        <NavItems>menu2</NavItems>
      </Nav>
    </Container>
  )
};

export default Navigation;
